script: |
  super -f text -I q5584.spq | sort > q5584.out

inputs:
  - name: q5584.spq
    data: |
      SELECT - - ( - col0 ) - + col0 AS col0 FROM tab1 (FORMAT parquet) WHERE NULL BETWEEN NULL AND - col2 * - - col2 * + 41 + + 91 + col2 * - 81 * + col1;
  - name: tab1

outputs:
  - name: q5584.out
    data: |
